import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';
import jsPDF from 'jspdf';
import 'jspdf-autotable';
import Header from './Header';
import styles from './Analysis.css'; // Import the CSS module

export default function Analysis() {
  const [patient, setPatient] = useState(null);
  const { id } = useParams();

  useEffect(() => {
    const getReportDetails = async () => {
      try {
        const response = await axios.get(`http://localhost:3001/en/getreportdetails?id=${id}`);
        setPatient(response.data);
      } catch (error) {
        console.error('Error fetching report details:', error);
      }
    };

    getReportDetails();
  }, [id]);

  const generatePDF = () => {
    if (!patient) {
      console.error('Patient data is not loaded yet.');
      return;
    }

    const doc = new jsPDF();

    doc.setFontSize(18);
    doc.text('SAANJH SAHAYAK', doc.internal.pageSize.width / 2, 10, { align: 'center' });
    doc.setFontSize(16);
    doc.text('Report Details', 10, 20);

    doc.setFontSize(12);
    doc.text(`ID: ${patient._id}`, 10, 35);
    doc.text(`Date of Report: ${patient.dateOfReport ? new Date(patient.dateOfReport).toLocaleDateString() : 'N/A'}`, 10, 45);
    doc.text(`Patient: ${patient.patient}`, 10, 55);

    const summaryLines = doc.splitTextToSize(patient.summary || '', doc.internal.pageSize.width - 20);
    doc.text('Summary:', 10, 65);
    summaryLines.forEach((line, index) => {
      if (index < 5) {
        doc.text(line, 15, 75 + index * 10);
      }
    });

    doc.text(`Severity: ${patient.severity}`, 10, 135);
    doc.text(`Specialist Required: ${patient.specialistReq}`, 10, 145);
    let yPos = 155;

    if (patient.precautions.length > 0) {
      doc.text('Precautions:', 10, yPos);
      yPos += 10;
      patient.precautions.forEach((precaution, index) => {
        yPos += 5;
        doc.text(`- ${precaution}`, 15, yPos + index * 10);
      });
      yPos += (patient.precautions.length * 10) + 10;
    }

    if (patient.doctorNotes) {
      doc.text('Doctor\'s Note:', 10, yPos);
      yPos += 10;
      const doctorNoteLines = doc.splitTextToSize(patient.doctorNotes, doc.internal.pageSize.width - 20);
      doctorNoteLines.forEach((line, index) => {
        doc.text(line, 15, yPos + index * 10);
      });
    }

    doc.save(`Report-${patient._id}.pdf`);
  };

  const handlePDFView = async () => {
    try {
      const response = await axios.get(`http://localhost:3001/en/files/${patient.file}`, { responseType: 'arraybuffer' });
  
      if (response.headers['content-type'] !== 'application/pdf') {
        throw new Error('Response is not a PDF file');
      }
  
      const binaryData = new Uint8Array(response.data);
      const blob = new Blob([binaryData], { type: 'application/pdf' });
      const url = window.URL.createObjectURL(blob);
  
      window.open(url, '_blank', 'noopener,noreferrer');
    } catch (error) {
      console.error("Error fetching PDF file:", error);
    }
  };

  return (
    <div className={styles.container}>
      <Header />
      <div className={`${styles.card} ${styles.transitionAll} ${styles.hoverShadow3xl}`}>
        <div className={styles.header}>
          <h2 className={`${styles.text4xl} ${styles.fontBold} ${styles.textCenter} ${styles.animatePulse}`}>Medical Report Analysis</h2>
        </div>
        <div className={styles.content}>
          <div className={styles.flex}>
            {[
              { label: "Report ID", value: patient?._id },
              { label: "Date of Report", value: patient?.dateOfReport ? new Date(patient.dateOfReport).toLocaleDateString() : 'N/A' },
              { label: "Patient Name", value: patient?.patient },
              { label: "Severity Level", value: patient?.severity }
            ].map((item, index) => (
              <div key={index} className={`${styles.wFull} ${styles.smW1_2} ${styles.lgW1_4} ${styles.px4} ${styles.mb4} ${styles.flex}`}>
                <div className={`${styles.flex1} ${styles.border2} ${styles.borderIndigo100} ${styles.roundedLg} ${styles.p4} ${styles.bgGradientToR} ${styles.fromGray50} ${styles.toBlue50} ${styles.hoverFromBlue50} ${styles.hoverToIndigo50} ${styles.transitionColors} ${styles.duration300} ${styles.easeInOut} ${styles.transform} ${styles.hoverTranslateY1} ${styles.hoverShadowMd} ${styles.flex} ${styles.flexCol} ${styles.justifyBetween}`}>
                  <p className={`${styles.textIndigo600} ${styles.textSm} ${styles.fontSemibold}`}>{item.label}</p>
                  <p className={`${styles.fontBold} ${styles.textLg} ${styles.textGray800} ${styles.mt2}`}>{item.value}</p>
                </div>
              </div>
            ))}
          </div>

          <div className={styles.borderT2}>
            <h3 className={`${styles.text2xl} ${styles.fontSemibold} ${styles.mb3} ${styles.textIndigo700}`}>Summary</h3>
            <div className={`${styles.bgGradientToR} ${styles.fromBlue50} ${styles.toIndigo50} ${styles.p6} ${styles.roundedLg} ${styles.border2} ${styles.borderBlue200} ${styles.shadowInner}`}>
              <p className={`${styles.textGray800}`}>{patient?.summary}</p>
            </div>
          </div>

          <div className={styles.flex}>
            <div className={`${styles.wFull} ${styles.mdW1_2} ${styles.px4} ${styles.mb4} ${styles.animateSlideInFromLeft}`}>
              <h3 className={`${styles.text2xl} ${styles.fontSemibold} ${styles.mb3} ${styles.textIndigo700}`}>Specialist Required</h3>
              <div className={`${styles.bgGradientToR} ${styles.fromGreen50} ${styles.toBlue50} ${styles.p6} ${styles.roundedLg} ${styles.border2} ${styles.borderGreen200} ${styles.fontMedium} ${styles.hFull} ${styles.flex} ${styles.itemsCenter} ${styles.justifyCenter}`}>
                <p className={`${styles.textGreen700} ${styles.fontBold}`}>{patient?.specialistReq}</p>
              </div>
            </div>
            <div className={`${styles.wFull} ${styles.mdW1_2} ${styles.px4} ${styles.mb4} ${styles.animateSlideInFromRight}`}>
              <h3 className={`${styles.text2xl} ${styles.fontSemibold} ${styles.mb3} ${styles.textIndigo700}`}>Precautions</h3>
              <ul className={`${styles.listDisc} ${styles.listInside} ${styles.bgGradientToR} ${styles.fromYellow50} ${styles.toOrange50} ${styles.p6} ${styles.roundedLg} ${styles.border2} ${styles.borderYellow200} ${styles.hFull}`}>
                {patient?.precautions.map((precaution, index) => (
                  <li key={index} className={`${styles.mb2} ${styles.textGray800}`}>{precaution}</li>
                ))}
              </ul>
            </div>
          </div>

          <div className={styles.animateSlideInFromBottom}>
            <h3 className={`${styles.text2xl} ${styles.fontSemibold} ${styles.mb3} ${styles.textIndigo700}`}>Possible Diseases</h3>
            <div className={`${styles.flex} ${styles.flexWrap} ${styles.mx2}`}>
              {patient?.possibleDiseases.map((disease, index) => (
                <div key={index} className={`${styles.wFull} ${styles.smW1_2} ${styles.mdW1_3} ${styles.lgW1_4} ${styles.px2} ${styles.mb4}`}>
                  <div className={`${styles.bgGradientToR} ${styles.fromRed50} ${styles.toPink50} ${styles.p4} ${styles.roundedLg} ${styles.border2} ${styles.borderRed200} ${styles.hFull} ${styles.flex} ${styles.itemsCenter} ${styles.justifyCenter}`}>
                    <span className={`${styles.textRed800} ${styles.textSm} ${styles.fontMedium}`}>
                      {disease}
                    </span>
                  </div>
                </div>
              ))}
            </div>
          </div>

          <div className={styles.animateSlideInFromBottom}>
            <h3 className={`${styles.text2xl} ${styles.fontSemibold} ${styles.mb3} ${styles.textIndigo700}`}>Doctor's Note</h3>
            <div className={`${styles.bgGradientToR} ${styles.fromPurple50} ${styles.toIndigo50} ${styles.p6} ${styles.roundedLg} ${styles.border2} ${styles.borderPurple200} ${styles.italic} ${styles.shadowInner}`}>
              <p className={`${styles.textGray800}`}>{patient?.doctorNotes}</p>
            </div>
          </div>

          <div className={`${styles.flex} ${styles.justifyCenter} ${styles.spaceX6} ${styles.mt10}`}>
            <button onClick={generatePDF} className={`${styles.px8} ${styles.py3} ${styles.bgGradientToR} ${styles.fromBlue600} ${styles.toIndigo600} ${styles.textWhite} ${styles.fontSemibold} ${styles.roundedFull} ${styles.hoverFromBlue700} ${styles.hoverToIndigo700} ${styles.transitionDuration300} ${styles.shadowMd} ${styles.hoverShadowLg} ${styles.hoverTranslateY1}`}>
              Download Report
            </button>
            <button onClick={handlePDFView} className={`${styles.px8} ${styles.py3} ${styles.bgGradientToR} ${styles.fromIndigo600} ${styles.toPurple600} ${styles.textWhite} ${styles.fontSemibold} ${styles.roundedFull} ${styles.hoverFromIndigo700} ${styles.hoverToPurple700} ${styles.transitionDuration300} ${styles.shadowMd} ${styles.hoverShadowLg} ${styles.hoverTranslateY1}`}>
              View Report
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}
